import Navbar from './Navbar';
import HeaderCourses from './Courses/Header';

import Footer from './Footer';

function Home() {
  return (
    <div>
      <Navbar />
      <HeaderCourses />
      <HeaderTeachers />
      <HeaderStudents />
      <Footer />
    </div>
  );
}

export default Home;
